import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Search = () => {
  const [pesel, setPesel] = useState("");
  const [start_date, setStartDate] = useState("");
  const [end_date, setEndDate] = useState("");
  const [product_name, setProductName] = useState("");
  const [prescriptions, setPrescriptions] = useState([]);
  const [prescriptionInformations, setPrescriptionInformations] = useState([]);

  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {
      pesel: pesel,
      startDate: start_date,
      endDate: end_date,
      productName: product_name,
    }).then((res) => {
      setPrescriptions(res.data);
      console.log(res.data);
    });
  };

  let PrescriptionList = prescriptions.map((prescription, i) => {
    console.log(prescription);
    return (
      <option key={i} value={i}>
        {prescription.codeEAN}
      </option>
    );
  }, this);
  return (
    <div className="App">
      <Header>Wyszukiwarka Recept</Header>
      <div className="inputsWrapper">
        <div>
          <label>Pesel:</label>
          <input
            type="text"
            name="pesel"
            onChange={(e) => {
              setPesel(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data od:</label>
          <input
            type="date"
            name="start_date"
            onChange={(e) => {
              setStartDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data do:</label>
          <input
            type="date"
            name="end_date"
            onChange={(e) => {
              setEndDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Nazwa Leku:</label>
          <input
            type="text"
            name="product_name"
            onChange={(e) => {
              setProductName(e.target.value);
            }}
          />
        </div>
      </div>

      <button onClick={getPrescriptionSearchData}>
        getPrescriptionSearchData
      </button>
      <select
        value
        onChange={(e) => {
          console.log(prescriptions[e.target.value]);
          setPrescriptionInformations(prescriptions[e.target.value]);
        }}
      >
        {PrescriptionList}
      </select>
      {prescriptionInformations != null && (
        // <div className="medicineTable">
        //   <div>
        //     <p>{prescriptionInformations.codeEAN}</p> <p>EAN</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.name}</p> <p>Nazwa</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.numberOfMedicinePackages}</p>{" "}
        //     <p>Ilość tabletek</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.paymentLevel}</p>{" "}
        //     <p>Procent odpłatności</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.prescriptionKey}</p>{" "}
        //     <p>Klucz recepty</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.prescriptionNr}</p>{" "}
        //     <p>Numer recepty</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.signingData}</p> <p>Data</p>
        //   </div>
        //   <div>
        //     <p>{prescriptionInformations.prescriptionStatus}</p> <p>Status</p>
        //   </div>
        // </div>
        <div class="st_wrap_table" data-table_id="1">
          <header class="st_table_header">
            <h1>Lekarstwa</h1>
          </header>
          <div class="st_table">
            <div class="st_row">
              <div class="st_column _name">Nazwa lekarstwa</div>
              <div class="st_column _value">{prescriptionInformations.codeEAN}</div>
            </div>
            <div class="st_row">
              <div class="st_column _name">numer EAN</div>
              <div class="st_column _value">{prescriptionInformations.name}</div>
            </div>
            <div class="st_row">
              <div class="st_column _name">Postać</div>
              <div class="st_column _value">{prescriptionInformations.numberOfMedicinePackages}</div>
            </div>
            <div class="st_row">
              <div class="st_column _name">Dawka</div>
              <div class="st_column _value">
                {information.dawka}
                {information.jednostka_dawki}
              </div>
            </div>
            <div class="st_row">
              <div class="st_column _name">Cena</div>
              <div class="st_column _value">{information.cena_detaliczna}</div>
            </div>
            <div class="st_row">
              <div class="st_column _name">Substancja czynna</div>
              <div class="st_column _value">
                {information.substancja_czynna}
              </div>
            </div>
            <div class="st_row">
              <div class="st_column _name">Zawartość opakowania</div>
              <div class="st_column _value">
                {information.zawartosc_opakowania}
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Search;
